$(function(){


	//Accordion
	var accordion = $('.accordion');

	// initialize any accordion
	accordion.each(function(){

		var accTrigger = $(this).children('.accTrigger');
		var accContent = $(this).children('.accContent').html();

		// pull the trigger
		accTrigger.click(function(){

			var element = $(this);

			// open or close accordion
			if ( element.next('.accContent').hasClass('active') == true ){
				element.next('.accContent').removeClass('active');
				element.parent().removeClass('act');
				element.next('.accContent').slideUp(300);
			} else {
				element.parent().parent().find('.accContent.active').removeClass('active');
				element.parent().parent().find('.accContent').slideUp(250);
				element.parent().parent().find('.accordion.act').removeClass('act');
				element.parent().toggleClass('act');
				element.next('.accContent').toggleClass('active');
				element.next('.accContent').slideToggle(300);
			}
		});
	});

});


$(function(){

	// console.log('tabs is ready');

	// tabs
	$('.tab__container').find('.tab').hide();

	$('.tab__container').each(function(key) {
		var _self = this;
		 $(_self).find('.tab_wrapper > .tab').each(function(index) {
	 		var cIndex = index + 1;
	 		$(this).attr('id','tab_' + (key+1) + '_' + cIndex);

	 		if ( cIndex == 1 ){
	 			$(this).show();
	 		}
	 	});

		$(_self).find('.tabs li').each(function(index){
			var cIndex = index + 1;
			$(this).attr('data-tab','tab_' + (key+1) + '_' + cIndex);

			if ( cIndex == 1 ){
				$(this).addClass('activetabnav');
			}
		});

		$(_self).find('.tabs li').click(function(){
			var tabId = $(this).data('tab');
			$(_self).find('.tab_wrapper > .tab').hide();
			$('[id^="tab"]').removeClass('activtab');
			$('#'+tabId).show();
			$('#'+tabId).addClass('activtab');
			$(_self).find('.tabs li').removeClass('activetabnav');
			$(this).addClass('activetabnav');
		});

	});


});


