$(function () {

	// Sticky Header on ready
	sticky_relocate();


	// Sticky Header on scroll
	$(window).on('scroll', function () {
		sticky_relocate();
	});


	// Lightbox magnific Popup for Image
	$('.lightbox').magnificPopup({
		type: 'image',
		gallery: {
			enabled: true
		}
	});

	// Lightbox magnific Popup for iFrame
	$('.popuplightbox').magnificPopup({
		type: 'iframe'
	});

	var curLang = $('html').attr('lang');

	switch (curLang) {
		case 'de':
			$.extend(true, $.magnificPopup.defaults, {
				tClose: 'Schließen',
				tLoading: 'Wird geladen...',
				gallery: {
					tPrev: 'Zurück',
					tNext: 'Weiter',
					tCounter: '%curr% von %total%'
				},
				image: {
					tError: 'Das <a href="%url%">Bild</a> konnte nicht geladen werden.'
				},
				ajax: {
					tError: 'Der <a href="%url%">Inhalt</a> konnte nicht geladen werden.'
				}
			});
			break;
		default:
		// english already included
	}

	// info box Unterseiten

	// Klasse der Box togglen
	$('.icon_active').click(function(){
		$(this).parents('.contact__person').toggleClass('toggle-unactive');
	});

	// desktopScreen beim Laden der Seite ausführen
	// desktopScreen();

	// desktopScreen beim Resizen ausführen
	// $( window ).resize(function() {
	// 	desktopScreen();
	// });

	// Beim Aufruf der Seite
	if (window.matchMedia("(min-width: 1200px)").matches) {
		$('.contact__person').removeClass('toggle-unactive');
	}

	// Beim Skalieren
	window.matchMedia("(min-width: 1200px)").addListener(function (e) {
		if(e.matches) {
			$('.contact__person').removeClass('toggle-unactive');
		} else {
			$('.contact__person').addClass('toggle-unactive');
		}
	});


	// datepicker
	$('input[type="date"]').attr({
		type: 'text',
		placeholder: 'Datum wählen',
		class: 'datepicker'
	}).datepicker({
		language: 'de-DE',
		format: 'dd.mm.yyyy'
	});

	// wrap all powermail fieldwraps with 50% or 33% in a new container
	$('.tx-powermail').each(function(){
		for (var i = 0; i < $(this).find(".width33powermail").length; i += 3) {
			$(this).find(".width33powermail").slice(i, i + 3).wrapAll("<div class='powermail_fieldwrap powermail_fieldwrap_width33'></div>");
		}
		for (var i = 0; i < $(this).find(".width50powermail").length; i += 2) {
			$(this).find(".width50powermail").slice(i, i + 2).wrapAll("<div class='powermail_fieldwrap powermail_fieldwrap_width50'></div>");
		}
	})


	// add a Class to the Table Parent
	$('table.contenttable').parent().addClass('table_container');

	// Powermail Erweitertes Formular
	$('.powermail_form_6 #powermail_field_objektart').change(function(){
		if ( $(this).val() == 'Gewerbe' ) {
			$('.powermail_form_6 .powermail_fieldwrap_anzahlzimmer').hide();
			$('.powermail_form_6 .powermail_fieldwrap_anzahlkellerraeume').hide();
		} else {
			$('.powermail_form_6 .powermail_fieldwrap_anzahlzimmer').show();
			$('.powermail_form_6 .powermail_fieldwrap_anzahlkellerraeume').show();
		}
	});

    // Activate ProvenExpert-Skript
    setTimeout(function(){
        let peScriptSrc = $('#peScript').attr('data-src');
        $('#peScript').attr('src', peScriptSrc);
    },3000);

});

// Sticky Header Fuction
function sticky_relocate() {
	var window_top = $(window).scrollTop();
	var div_top = $('.sticky-anchor').offset().top;
	if (window_top > div_top) {
		$('.head').addClass('stickyhead');
	} else {
		$('.head').removeClass('stickyhead');
	}
}

